Mongo db query where condition for a column (list of values) having a value<p>I am trying to find a way to filter the records in Mongo db using Spring query.
Here is the scenario, let's see I have an Activity entity/document. One of the fields is a list of names. I want to see if I can get all the records that the names field includes get given value, let's say "Joker". </p>

<p>For example, my json in Mongo is </p>

<p>Activity 1 - </p>

<p>{
  "_id" : ObjectId("52c14eb92f7ceb854e445354"),
  ...
  "names" : [{
      "username" : "username1",
      "realname" : "Super Man"
    }, {
      "username" : "username2",
      "realname" : "Iron Man"
    }]
}</p>

<p>Activity 2 - </p>

<p>{
  "_id" : ObjectId("52c14eb92f7ceb854e445355"),
  ...
  "names" : [{
      "username" : "username3",
      "realname" : "Bat Man"
    }, {
      "username" : "username4",
      "realname" : "Joker"
    }]
}</p>

<p>And I expect the query will let me get Activity 2 only.</p>

<p>Also, if possible, I prefer to use spring Mongo query in my code. Thanks in advance.         </p>

